Rocket Jockey, by Sega and Rocket Science Games.

ESRB Rating: E


It's often impossible to get the game to install on XP. However, all that's really needed to make it run is a registry modification.

If your CD Rom drive is D:,  then simply install &quot;XP hack.reg&quot;

If not, edit the text file &quot;XP hack edit me.txt&quot;

Edit both &quot; Path&quot;= &quot; and @=  TO MATCH THE FOLDER YOU downloaded this game to. Then afterwards, rename &quot;XP hack edit me.txt&quot; to &quot;XP hack edit me.reg&quot;

Install &quot;XP hack edit me.txt&quot;, and hit JOCKEY.EXE to play.
